import React, { useState, useEffect } from 'react';
import Papa from 'papaparse';

function App() {
  const [text, setText] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch('https://woot-hyperiums.s3.eu-west-1.amazonaws.com/data/planets.txt');
      const textData = await response.text();
      setText(textData);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>Text File Example</h1>
      <p>{text}</p>
    </div>
  );
}

export default App;
